/*Table structure for table `gm_account` */

DROP TABLE IF EXISTS `gm_account`;

CREATE TABLE `gm_account` (
  `account_id` bigint(30) NOT NULL AUTO_INCREMENT,
  `account_name` varchar(50) DEFAULT NULL COMMENT '帐号',
