  `contact_name` varchar(50) DEFAULT NULL COMMENT '联系人姓名',
  `contact_job` varchar(50) DEFAULT NULL,
  `phone` varchar(11) DEFAULT NULL COMMENT '手机',
  `telephone` varchar(20) DEFAULT NULL COMMENT '固定电话',
  `qq` varchar(20) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `password` varchar(50) DEFAULT NULL COMMENT '录登密码',
  `user_key` varchar(100) DEFAULT NULL COMMENT '访问控制',
  `create_time` timestamp NULL DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`account_id`),
  KEY `index_account_id` (`account_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8;

