/*Table structure for table `gm_action` */

DROP TABLE IF EXISTS `gm_action`;

CREATE TABLE `gm_action` (
  `action_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '动作id',
  `action_name` varchar(50) NOT NULL COMMENT '动作名称',
  `status` tinyint(2) DEFAULT '1' COMMENT '状态1:正常,2:失效',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_user` varchar(50) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`action_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `gm_action` */

/*Table structure for table `gm_ads` */

DROP TABLE IF EXISTS `gm_ads`;

CREATE TABLE `gm_ads` (
  `ads_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '广告位id',
  `pic_name` varchar(100) DEFAULT NULL COMMENT '图片名称',
  `pic_path` varchar(80) NOT NULL COMMENT '图片路径',
  `goods_name` varchar(50) DEFAULT NULL COMMENT '商品名称',
  `links` varchar(80) DEFAULT NULL COMMENT '外链',
  `sort` tinyint(2) DEFAULT '1' COMMENT '排序',
  `status` int(2) DEFAULT NULL COMMENT '状态',
  `create_user` varchar(30) DEFAULT NULL COMMENT '创建人',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_user` varchar(30) DEFAULT NULL COMMENT '修改人',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `ads_channel_id` bigint(20) DEFAULT NULL COMMENT '频道分类id',
  `device_category_id` bigint(20) DEFAULT NULL COMMENT '设备分类id',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ads_id`)
