/*Table structure for table `gm_device_function` */

DROP TABLE IF EXISTS `gm_device_function`;

CREATE TABLE `gm_device_function` (
  `function_id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT '功能id',
  `device_function_id` varchar(38) NOT NULL COMMENT '设备id',
  `function_name` varchar(32) DEFAULT NULL COMMENT '功能名称',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_user` varchar(20) DEFAULT NULL COMMENT '创建人',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  `update_user` varchar(20) DEFAULT NULL COMMENT '修改人',
  `before_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '上次修改时间',
  `before_user` varchar(20) DEFAULT NULL COMMENT '上次修改人',
  `function_code` bigint(10) DEFAULT NULL COMMENT '功能编码',
  `function_status` tinyint(2) DEFAULT '1' COMMENT '功能状态，1启用，2未启用',
  `function_value` varchar(32) DEFAULT NULL COMMENT '功能值',
  `scene_id` bigint(12) DEFAULT NULL,
  PRIMARY KEY (`function_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3188 DEFAULT CHARSET=utf8;

