DROP TABLE IF EXISTS `gm_device_task`;

CREATE TABLE `gm_device_task` (
  `task_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '任务id',
  `start_time` datetime DEFAULT NULL COMMENT '任务开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '任务结束时间',
  `operate_model` tinyint(2) NOT NULL DEFAULT '0' COMMENT '操作模式1:开,0:关',
  `device_key` varchar(100) NOT NULL COMMENT '设备id',
  `redo_qty` tinyint(2) DEFAULT '4' COMMENT '重试次数',
  `task_status` tinyint(2) DEFAULT NULL COMMENT '任务状态0:未开始,1:成功,2:失败',
  `device_app_id` bigint(20) DEFAULT NULL COMMENT '设备应用id，目前暂未使用',
  `create_user` varchar(30) DEFAULT NULL COMMENT '创建人',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(30) DEFAULT NULL COMMENT '修改人',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`task_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `gm_device_task` */

/*Table structure for table `gm_device_type` */

DROP TABLE IF EXISTS `gm_device_type`;

CREATE TABLE `gm_device_type` (
  `id` bigint(10) NOT NULL AUTO_INCREMENT,
  `device_type` tinyint(3) DEFAULT NULL COMMENT '设备类型',
  `device_type_name` varchar(20) DEFAULT NULL COMMENT '设备类型名称',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `create_user` varchar(20) DEFAULT NULL,
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_user` varchar(20) DEFAULT NULL,
  `status` tinyint(2) DEFAULT '1' COMMENT '0为未启用，1为启用',
  `pic_url` varchar(50) DEFAULT NULL COMMENT '图片路径',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

