/*Table structure for table `gm_params` */

DROP TABLE IF EXISTS `gm_params`;

CREATE TABLE `gm_params` (
  `id` bigint(12) NOT NULL AUTO_INCREMENT,
  `param_name` varchar(32) DEFAULT NULL COMMENT '变量名称',
  `param_code` bigint(12) DEFAULT NULL COMMENT '变量编码',
  `create_time` date DEFAULT NULL,
  `status` tinyint(2) DEFAULT '1' COMMENT '是否有效(0无效，1有效)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;

/*Data for the table `gm_params` */

insert  into `gm_params`(`id`,`param_name`,`param_code`,`create_time`,`status`) values (1,'频道',1,NULL,1),(2,'声音',2,NULL,1),(3,'颜色',3,NULL,1),(4,'音量控制',4,NULL,1),(5,'模式',5,NULL,1),(6,'是否扫风',6,NULL,1),(7,'风速级别设置',7,NULL,1),(8,'温度设置',8,NULL,1),(9,'风类设置',9,NULL,1),(10,'是否静音',10,NULL,1),(11,'是否摆头',11,NULL,1),(12,'投影比例',12,NULL,1),(13,'CD播放',13,NULL,1),(14,'开机时间',14,NULL,1),(15,'关机时间',15,NULL,1);

/*Table structure for table `gm_product` */

DROP TABLE IF EXISTS `gm_product`;

CREATE TABLE `gm_product` (
  `product_id` bigint(30) NOT NULL AUTO_INCREMENT,
  `product_uuid` varchar(255) DEFAULT NULL,
  `product_name` varchar(100) NOT NULL COMMENT '产品名称',
  `product_desc` varchar(300) DEFAULT NULL COMMENT '产品描述',
  `product_state` int(10) DEFAULT NULL COMMENT '0.发布 1.新建未审核 2.审核中 3.审核不通过',
  `category_id` bigint(30) NOT NULL DEFAULT '0' COMMENT '产品类型',
  `product_model` varchar(48) NOT NULL COMMENT '产品型号',
  `config_type` int(10) DEFAULT NULL COMMENT '设备类型(1.普通设备(不需要网关)2.网关设备 3.网关配件)',
  `config_type_code` int(10) DEFAULT NULL COMMENT '产品联网类型(wifi,3G,蓝牙)',
  `protocol_version` int(10) NOT NULL COMMENT '1.国美设备发现协议 2.远程设备发现协议 3.自有设备发现协议',
  `product_manual` varchar(255) DEFAULT NULL COMMENT '产品配置',
  `join_type` int(10) NOT NULL COMMENT '产品接入方式(1. 直连 2 云中转)',
  `pic_url` varchar(100) DEFAULT NULL COMMENT '产品图片',
  `product_secret` varchar(255) DEFAULT NULL COMMENT '产品秘钥',
  `create_user` bigint(30) DEFAULT NULL,
  `update_user` bigint(30) DEFAULT NULL,
  `create_time` timestamp NULL DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `device_category_id` int(10) DEFAULT NULL COMMENT '设备类型ID',
  `third_party` int(4) DEFAULT NULL COMMENT '第三方参数',
  `product_short_name` varchar(50) DEFAULT NULL COMMENT '精简名称',
  `purchase_now_url` varchar(100) DEFAULT NULL COMMENT '立即购买',
  PRIMARY KEY (`product_id`),
  UNIQUE KEY `index_product_id` (`product_id`),
  KEY `ref_product_user` (`create_user`),
  KEY `ref_product_category_id` (`category_id`),
  CONSTRAINT `ref_product_category_id` FOREIGN KEY (`category_id`) REFERENCES `gm_product_category` (`category_id`),
  CONSTRAINT `ref_product_user` FOREIGN KEY (`create_user`) REFERENCES `gm_account` (`account_id`)
) ENGINE=InnoDB AUTO_INCREMENT=50 DEFAULT CHARSET=utf8 COMMENT='InnoDB free: 9216 kB; (`create_user`) REFER `gmsc/gm_account';

