/*Table structure for table `gm_product_category` */

DROP TABLE IF EXISTS `gm_product_category`;

CREATE TABLE `gm_product_category` (
  `category_id` bigint(30) NOT NULL AUTO_INCREMENT,
  `category_name` varchar(50) NOT NULL COMMENT '分类名称',
  `category_level` int(10) NOT NULL COMMENT '分类等级',
  `parent_id` bigint(30) NOT NULL COMMENT '分类上级ID',
  `category_state` int(10) DEFAULT NULL,
  `create_user` bigint(30) DEFAULT NULL,
  `update_user` bigint(30) DEFAULT NULL,
  `create_time` timestamp NULL DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`category_id`),
  UNIQUE KEY `index_category_id` (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

