/*Table structure for table `gm_product_device` */

DROP TABLE IF EXISTS `gm_product_device`;

CREATE TABLE `gm_product_device` (
  `id` bigint(30) NOT NULL AUTO_INCREMENT,
  `device_id` varchar(100) NOT NULL COMMENT '设备ID 同一产品中必须唯一',
  `product_id` bigint(30) DEFAULT NULL COMMENT '产品ID',
  `access_key` varchar(255) DEFAULT NULL COMMENT '设备操作权限码',
  `device_key` varchar(255) DEFAULT NULL COMMENT '设备在云端的id',
  `device_state` int(10) DEFAULT '0' COMMENT '设备状态  1.激活',
  `create_time` timestamp NULL DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `user_id` bigint(30) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ref_device_product_id` (`product_id`),
  CONSTRAINT `ref_device_product_id` FOREIGN KEY (`product_id`) REFERENCES `gm_product` (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `gm_product_device` */

/*Table structure for table `gm_product_rule` */

DROP TABLE IF EXISTS `gm_product_rule`;

CREATE TABLE `gm_product_rule` (
  `rule_id` bigint(30) NOT NULL AUTO_INCREMENT,
  `rule_name` varchar(50) DEFAULT NULL,
  `rule_type` int(10) DEFAULT NULL COMMENT '推送类型(1.通知 2.报警)',
  `vaild_time` int(10) DEFAULT NULL COMMENT '规则时效(1:1小时 2:1天 3:1周)',
  `context` varchar(255) DEFAULT NULL COMMENT '推送内容',
  `create_time` timestamp NULL DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `product_id` bigint(30) DEFAULT NULL,
  PRIMARY KEY (`rule_id`),
  KEY `index_rule_id` (`rule_id`),
  KEY `rule_ref_peoduct_id` (`product_id`),
  CONSTRAINT `rule_ref_peoduct_id` FOREIGN KEY (`product_id`) REFERENCES `gm_product` (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `gm_product_rule` */

/*Table structure for table `gm_product_stream` */

DROP TABLE IF EXISTS `gm_product_stream`;

CREATE TABLE `gm_product_stream` (
  `id` bigint(30) NOT NULL AUTO_INCREMENT,
  `stream_id` varchar(255) DEFAULT NULL,
  `stream_type` int(10) DEFAULT NULL COMMENT 'stream的类型，0代表“控制型”流，1代表“感知型”流',
  `stream_name` varchar(50) DEFAULT NULL COMMENT '参数名称',
  `unit_name` varchar(255) DEFAULT NULL COMMENT '单位名称',
  `unit_sign` varchar(255) DEFAULT NULL COMMENT '单位符号',
  `para_type` int(10) DEFAULT NULL COMMENT '参数类型(1:int 2:float 3:string)',
  `para_max` varchar(20) DEFAULT '' COMMENT '参数的最大值',
  `para_min` varchar(20) DEFAULT '' COMMENT '参数的最小值',
  `control_type` int(10) DEFAULT NULL COMMENT '可控(可控”1：可控 0：不可控，表示您的参数可以被控制，如：“开关”；“不可控”表示您的参数不可被控制，如：“PM2.5”；)',
  `product_id` bigint(30) NOT NULL,
  `create_time` timestamp NULL DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `del_flag` int(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ref_product_id` (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=99 DEFAULT CHARSET=utf8;

