CREATE TABLE `gm_scene_detail` (
  `scene_detail_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '场景明细id',
  `device_type` bigint(20) NOT NULL COMMENT '设备类型id',
  `device_type_name` varchar(50) NOT NULL COMMENT '设备类型名称',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态1：正常，0：失效',
  `create_user` varchar(30) DEFAULT NULL COMMENT '创建人',
  `update_user` varchar(30) DEFAULT NULL COMMENT '修改人',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `scene_id` bigint(20) NOT NULL COMMENT '场景id',
  `theme_id` bigint(20) NOT NULL COMMENT '主题id',
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户id',
  `pic_url` varchar(80) DEFAULT NULL COMMENT '图片路径',
  PRIMARY KEY (`scene_detail_id`)
) ENGINE=InnoDB AUTO_INCREMENT=50 DEFAULT CHARSET=utf8;

