/*Table structure for table `gm_smart_device` */

DROP TABLE IF EXISTS `gm_smart_device`;

CREATE TABLE `gm_smart_device` (
  `id` bigint(30) NOT NULL COMMENT '设备唯一标识 与access_key 一起控制app与设备之间的数据交换',
  `device_id` varchar(100) NOT NULL COMMENT '设备ID',
  `product_id` bigint(30) NOT NULL COMMENT '产品Id',
  `access_key` varchar(100) DEFAULT NULL COMMENT '用户/设备进行数据访问的权限',
  `private` char(2) DEFAULT NULL COMMENT '是否私有',
  `pro_type` char(2) DEFAULT NULL COMMENT '产品类型',
  `public_flag` char(2) DEFAULT NULL COMMENT '是否为1、公共设备  默认为0、私有设备。',
  `create_date` varchar(20) DEFAULT NULL COMMENT '创建时间',
  `modify_per` varchar(20) DEFAULT NULL COMMENT '修改人',
  `modify_date` varchar(20) DEFAULT NULL COMMENT '修改时间',
  `device_version` varchar(20) DEFAULT NULL COMMENT '设备版本',
  `client_info` varchar(100) DEFAULT NULL COMMENT '客户端传输信息',
  `mac` varchar(30) DEFAULT NULL COMMENT 'mac地址',
  `channel` varchar(30) DEFAULT NULL COMMENT '数据来源',
  `main_sub_type` char(2) DEFAULT NULL COMMENT '主从类型 0 一般设备(缺省)；1 主设备；2从设备',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `typeIdentifier` varchar(200) DEFAULT NULL COMMENT '设备类型唯一编码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `gm_smart_device` */

