/*Table structure for table `gm_smart_device_task` */

DROP TABLE IF EXISTS `gm_smart_device_task`;

CREATE TABLE `gm_smart_device_task` (
  `task_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户id',
  `device_id` bigint(20) DEFAULT NULL COMMENT '对应设备主键id',
  `task_name` varchar(50) DEFAULT NULL COMMENT '定时任务名称',
  `task_status` char(1) DEFAULT NULL COMMENT '定时任务状态，0关闭1启动',
  `cronexpression` varchar(20) DEFAULT NULL COMMENT '表达式构造器',
  `task_stream` varchar(500) DEFAULT NULL COMMENT '定时任务指令集',
  `frequency` varchar(10) DEFAULT NULL COMMENT '定时执行频率，周一到周日（0000000），0代表不执行1代表执行，例如：1000000每周一执行；1111111每天都执行',
  `frequency_hour` varchar(10) DEFAULT NULL COMMENT '定时执行频率-小时',
  `frequency_min` varchar(10) DEFAULT NULL COMMENT '定时执行频率-分钟',
  `create_time` varchar(20) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`task_id`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8;

/*Data for the table `gm_smart_device_task` */

insert  into `gm_smart_device_task`(`task_id`,`user_id`,`device_id`,`task_name`,`task_status`,`cronexpression`,`task_stream`,`frequency`,`frequency_hour`,`frequency_min`,`create_time`) values (53,71449407588,144723276270201297,'53','1','0 54 21 ? * 1,2','[{\"stream_id\":\"power\",\"value\":\"OFF\"}]','1100000','21','54','2015-11-19 14:40:14');

/*Table structure for table `gm_smart_device_task_log` */

DROP TABLE IF EXISTS `gm_smart_device_task_log`;

CREATE TABLE `gm_smart_device_task_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `task_id` bigint(20) DEFAULT NULL COMMENT '任务id',
  `task_status` char(1) DEFAULT NULL COMMENT '任务执行状态。-1异常，2执行失败',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '任务执行日期',
  `exception_detail` text COMMENT '任务失败异常日志信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

