/*Table structure for table `gm_theme` */

DROP TABLE IF EXISTS `gm_theme`;

CREATE TABLE `gm_theme` (
  `theme_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主题id',
  `theme_name` varchar(20) NOT NULL COMMENT '主题名称',
  `theme_price` float NOT NULL DEFAULT '0' COMMENT '主题价格',
  `subscribe_num` int(10) DEFAULT NULL COMMENT '主题订阅次数',
  `star_level` float DEFAULT NULL COMMENT '星级',
  `version_num` varchar(10) DEFAULT NULL COMMENT '版本号',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `status` tinyint(2) DEFAULT NULL COMMENT '主题状态1:正常,0:失效',
  `catalog_id` bigint(20) NOT NULL COMMENT '分类id',
  `create_user` varchar(30) DEFAULT NULL COMMENT '创建人',
  `update_user` varchar(30) DEFAULT NULL COMMENT '修改人',
  `recommend_level` tinyint(2) DEFAULT NULL COMMENT '推荐等级',
  `pic_path` varchar(100) DEFAULT NULL COMMENT '主题图片路径',
  `description` varchar(100) DEFAULT NULL COMMENT '主题描述',
  `theme_type` tinyint(2) DEFAULT '0' COMMENT '主题类型0:内置，1;外部添加',
  `profile` varchar(50) DEFAULT NULL COMMENT '主题简介',
  `pic_path_grid` varchar(80) DEFAULT NULL COMMENT '网格主题图片',
  PRIMARY KEY (`theme_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

/*Data for the table `gm_theme` */

