/*Table structure for table `gm_user_device` */

DROP TABLE IF EXISTS `gm_user_device`;

CREATE TABLE `gm_user_device` (
  `id` bigint(30) NOT NULL AUTO_INCREMENT COMMENT '主键ID自增序列',
  `user_id` bigint(30) NOT NULL COMMENT '用户ID',
  `device_key` varchar(50) DEFAULT NULL COMMENT 'devicekey,设备唯一标识',
  `device_name` varchar(50) DEFAULT NULL COMMENT '设备名称',
  `create_date` varchar(20) DEFAULT NULL COMMENT '创建时间',
  `own_flag` char(2) DEFAULT NULL COMMENT '设备拥有属性    0被人分享给自己设备,默认 1自己拥有设备',
  `remark` text COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=257 DEFAULT CHARSET=utf8;

